import Link from 'next/link';

function Header() {
  return (
    <>
      <nav className="flex justify-between h-16 border items-center">
        <Link href="/">
          <a className="text-red">Logo</a>
        </Link>
        <ul className="flex items-center">
          <Link href="/writing">
            <li className="text-teal-900 mr-6">Writing</li>
          </Link>
          <Link href="/about">
            <li className="text-teal-900 mr-6">About</li>
          </Link>
        </ul>
      </nav>
    </>
  );
}

export default Header;
